import React, { useEffect, useState } from "react";
import axios from "axios";
import TopBar from "../components/TopBar";
import dayjs from "dayjs";

function TablingLogs() {
  const [logs, setLogs] = useState([]);
  const [groupedLogs, setGroupedLogs] = useState({});

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const res = await axios.get("/api/organizations/all-logs");
        const allLogs = [];

        for (const orgName of res.data) {
          const orgRes = await axios.get(`/api/organizations/${encodeURIComponent(orgName)}`);
          const reservations = orgRes.data.reservations.map((r) => ({ ...r, organization: orgRes.data.name }));
          allLogs.push(...reservations);
        }

        const grouped = {};
        allLogs.forEach((entry) => {
          if (!entry.eventNumber) return;
          if (!grouped[entry.eventNumber]) grouped[entry.eventNumber] = { check_in: null, check_out: null, no_show: null };
          grouped[entry.eventNumber][entry.action] = entry;
        });

        setGroupedLogs(grouped);
      } catch (err) {
        console.error("Failed to load logs", err);
      }
    };

    fetchLogs();
  }, []);

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <TopBar />
      <div className="max-w-7xl mx-auto p-6">
        <h2 className="text-3xl font-bold text-asuGold mb-6 text-center">Tabling Logs</h2>

        <div className="space-y-6">
          {Object.entries(groupedLogs).map(([eventNumber, actions]) => {
            const checkIn = actions.check_in;
            const checkOut = actions.check_out;
            const noShow = actions.no_show;

            return (
              <div key={eventNumber} className="bg-gray-800 rounded-lg shadow p-4 border border-gray-700">
                <h3 className="text-xl text-asuGold font-semibold">Event #: {eventNumber}</h3>
                <p><strong>Organization:</strong> {checkIn?.organization || checkOut?.organization || noShow?.organization || "N/A"}</p>
                <p><strong>Client:</strong> {checkIn?.clientName || checkOut?.clientName || "-"}</p>
                <p><strong>Tabling Spot:</strong> {checkIn?.tablingSpot || checkOut?.tablingSpot || noShow?.tablingSpot || "-"}</p>

                {noShow ? (
                  <p className="text-red-400 mt-2 font-semibold">‚ùå No-Show from {dayjs(noShow.rangeStart).format("h:mm A")} to {dayjs(noShow.rangeEnd).format("h:mm A")}</p>
                ) : (
                  <>
                    <p><strong>Check-In Time:</strong> {checkIn?.checkInTime ? dayjs(checkIn.checkInTime).format("MMM D, YYYY h:mm A") : "-"}</p>
                    <p><strong>Check-Out Time:</strong> {checkOut?.checkOutTime ? dayjs(checkOut.checkOutTime).format("MMM D, YYYY h:mm A") : "-"}</p>
                    <p><strong>Handled By:</strong> {checkIn?.user || checkOut?.user || "-"}</p>
                    <p><strong>Table Barcode:</strong> {checkIn?.table?.barcode || "None"}</p>
                    <p><strong>Chairs:</strong> {checkIn?.chairs?.map(c => c.barcode).join(", ") || "None"}</p>
                  </>
                )}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default TablingLogs;
